import logo from './logo.svg';
import './App.css';
import React from 'react';
import PizzaForm from './PizzaForm';
import Routes from "./routes";

function App() {
  return (
    <div className="App">
      <header className="App-header">
        <img src={logo} className="App-logo" alt="logo" />
      </header>
      <Routes/>
        <PizzaForm />
    </div>
  );
}

export default App;
